Breadth-First Search & Depth-First Search
BFS Java Example
class Node {
    public int value;
    public Node left;
    public Node right;
}
public void bfs(Node root) {
    if(root == null) return;
    Queue queue = new LinkedList<>();
    queue.offer(root);
    while(!queue.isEmpty()) {
        Node node = queue.poll();
        System.out.print(node.value);// visit node
        if(node.left != null) queue.offer(node.left);
        if(node.right != null) queue.offer(node.right);
    }
}

DFS Java Example
class Node {
    public int value;
    public Node left;
    public Node right;
}
public void dfsRecursion(Node node) {
    if(node == null) return;
    System.out.print(node.value);// visit node
    // visit left
    dfsRecursion(node.left);
    // visit right
    dfsRecursion(node.right);
}

public void dfsStack(Node root) {
    if(node == null) return;
    Stack stack = new Stack<>();
    stack.push(root); 
    while (!stack.empty()) {
        Node node = stack.pop();
        System.out.println(node.value);// visit node
        // visit left node's path until end, same as the recursion version
        if(node.left != null) stack.push(node.left); 
        if(node.right != null) stack.push(node.right); 
    }  
}

